/Users/morgansegura/mo/_clients/liverpoo.query:
query PageBySlug(
  $uid: String!
) {
  prismicPage(uid: {eq: $uid}) {
    uid
    data {
      title {
        text
      }
      content {
        html
      }
    }
  }
}

query IndexQuery {
  site {
    siteMetadata {
      title
    }
  }
  prismicHomepage {
    slugs
    uid
    id
    data {
      title {
        text
      }
      content {
        html
      }
    }
  }
}

